import "./style/CardBlog.css"
function CardBlog(){
    return(

          <div class="blog-card">
            <div class="product-img">

            </div>
            <div class="product-info">
              <div class="product-text">
                <h1>Golden Rose Hotel</h1>
                <h2>by studio and friends</h2>
                {/* <p>Harvest Vases are a reinterpretation<br/> of peeled fruits and vegetables as<br/> functional objects. The surfaces<br/> appear to be sliced and pulled aside,<br/> allowing room for growth. </p> */}
                <p>Hotel Golden Rose à Oléron vous convie dans l’univers douillet de ses 9 chambres et suites, qui offrent <span class="span-brown">une vue imprenable sur l’océan ou sur le jardin de l’hôtel. </span>

<br/> <br/>Spacieuses, lumineuses et parfaitement équipées, elles vous réservent tout le confort d’une hôtellerie haut de gamme.

Dans une ambiance chaleureuse où les matières naturelles s’associent délicatement avec des teintes douces, vous vivez l’expérience de nuits bercées par le bruit des vagues. <br/> <br/>


</p>
              </div>
              {/* <div class="product-price-btn">
                <p><span>78</span>$</p>
                <button type="button">buy now</button>
              </div> */}
            </div>
          </div>



    )
}
export default CardBlog;
